        startPos[i] = rad * (-1 / timeScaler + 1 / currentAverageSpeed[i]) * (zeroTime - driverArrays[i][4]);
      } else {
        startPos[i] = rad * (1 / averageSpeed[i]) * (zeroTime - driverArrays[i][4]);
      }
      console.log(currentAverageSpeed[i]);
    }
    //parseData(testTimes[buttonCount]); //but do new data here instead of that
  }

  const slider = document.getElementById("speedSlider");
  let id = null;
  let elem = [];
  for (let i = 0; i < numCars; i++) {
    elem[i] = document.getElementById("animate" + i);
  }
  for (let i = 4; i >= numCars; i--) {
    document.getElementById("animate" + i).style.visibility = "hidden";
  }
  let bounds = 400;
  let carWidth = 30;
  let carHeight = 60;
  let xPosStart = -10 + (bounds - carWidth) / 2;
  let yPosStart = (bounds - carHeight) / 2;
  let xPos = 0;
  let yPos = 0;
  let reset = 0;
  let t = [Math.PI / 2, Math.PI / 2, Math.PI / 2, Math.PI / 2, Math.PI / 2]; /*starting position on 0 rad*/
  let rot = 0;
  clearInterval(id);
  id = setInterval(frame, 5);
  let animationActive = 1;
  function frame() {
    for (let i = 0; i < numCars; i++) {
      t[i] += animationActive * (0.0077 * timeScaler / times[i] * (Math.pow(slider.value / 50, 2) + 0.25)); /*max slider of 4 min of .25*/
      let tOffset = startPos[i]; /*(i * Math.PI) / (numCars / 2);*/
      let maxRadius = 195 - carWidth / 2;
      xPos = xPosStart + (maxRadius - (carWidth + 2) * (numCars - i - 1)) * Math.cos(t[i] + tOffset) + 10;
      yPos = yPosStart + (maxRadius - (carWidth + 2) * (numCars - i - 1)) * Math.sin(t[i] + tOffset);
      document.getElementById("timeText").textContent = "Time: " + t[0];
      elem[i].style.transform = "rotate(" + (180 + -180 / Math.PI * (t[i] + tOffset)) + "deg)";
      elem[i].style.top = xPos + "px";
      elem[i].style.left = yPos + "px";
      if (!reset && t[0] > -0.1 + 5 * Math.PI / 2) {
        animationActive = 0;
        clearInterval(id);
        startNextLap();
        reset = 1;
        //console.log("lap complete");
      }
    }
  }
}

